insert  into `bbm_group`(`id`,`group_name`,`group_detail`,`country_id`,`account_id`,`date_added`,`date_updated`) values (5,'Double Shotts Promotions','Double Shotts Promotions is your exclusive guide to the hottest social, cultural, and professional events in the Jamaica. We only host our events at the finest venues, with usage of the hottest DJs, MCs, bands, and talent.\r\n\r\nWe believe that the Double Shotts Promotions is the most exciting leisure company in the Jamaica. Our market, location based entertainment, or more specifically visitor attractions, is dynamic, fast growing and fun. Within this, Double Shotts Promotions is truly unique both in terms of its breath of quality branded businesses and its unrivaled commercial success.\r\n\r\nOur Vision\r\nTo become Jamaica\'s leader in branded, location based entertainment.\r\n\r\nOur Strategy\r\nTo create a high growth, international, family entertainment company with strong brands and a portfolio that is naturally hedged against external factors such as weather or localized market conditions.\r\n\r\nOur strategy will be delivered through:\r\n\r\nOrganic growth\r\nContinuing planned and predictable capital expenditure cycles appropriate to each Operating Group will provide the main drivers to growth across our existing estate. This will be complemented by strong price and yield management strategies based on continually improving guest experience.\r\n\r\n\r\nStay Connected:::\r\n? [<a href=\'https://www.facebook.com/doubleshottspromotions\' target=\'_blank\'>https://www.facebook.com/doubleshottspromotions</a>]\r\n? [<a href=\'https://www.facebook.com/groups/DOUBLESHOTTS\' target=\'_blank\'>https://www.facebook.com/groups/DOUBLESHOTTS</a>]\r\n.....................................................\r\n? |Blackberry pin:27f2e774\r\n? |@DoubleShotts\r\n? |double.shotts.promotions@skuii.net',106,512,'2013-04-05 09:28:02','2013-04-05 09:28:02');
