insert  into `people`(`id`,`fname`,`lname`,`gender`,`gender_prefrence`,`dob`,`hide_age`,`status`,`about_me`,`email`,`password`,`country_id`,`country_zone_id`,`education_level_id`,`job_category_id`,`fb_id`,`date_added`,`date_updated`) values (577,'Dayna','Bowers',NULL,NULL,NULL,0,'1','THE ONE &&& ONLY!!!\r\nyou can\'t clone me.\r\ngot alot of haters & alot of homies, some friends & some phony\'Z......\r\n\r\ni WILL SHARE IT WITH U LATER............jUST A PIECE FOR NOW...\r\nI\'m Jamaican...      I am Me. In all the world, there is no one else exactly like me. Everything that comes out of me is authentically mine, because I alone chose it -- I own everything about me: my body, my feelings, my mouth, my voice, all my actions, whether they be to others or myself. I own my fantasies, my dreams, my hopes, my fears. I own my triumphs and successes, all my failures and mistakes. Because I own all of me, I can become intimately acquainted with me. By so doing, I can love me and be friendly with all my parts. I know there are aspects about myself that puzzle me, and other aspects that I do not know -- but as long as I am friendly and loving to myself, I can courageously and hopefully look for solutions to the puzzles and ways to find out more about me. However I look and sound, whatever I say and do, and whatever I think and feel at a given moment in time is authentically me. If later some parts of how I looked, sounded, thought, and felt turn out to be unfitting, I can discard that which is unfitting, keep the rest, and invent something new for that which I discarded. I can see, hear, feel, think, say, and do. I have the tools to survive, to be close to others, to be productive, and to make sense and order out of the world of people and things outside of me. I own me, and therefore, I can engineer me. I am me, and I am Okay.','dayna1589@hotmail.com','5f4dcc3b5aa765d61d8327deb882cf99',1,NULL,NULL,NULL,501575093,'2013-01-07 18:18:32','2013-01-07 18:18:32');
