insert  into `people`(`id`,`fname`,`lname`,`gender`,`gender_prefrence`,`dob`,`hide_age`,`status`,`about_me`,`email`,`password`,`country_id`,`country_zone_id`,`education_level_id`,`job_category_id`,`fb_id`,`date_added`,`date_updated`) values (669,'Mit','Shah','M','F','1993-08-31',0,'1','I am a harmless\r\nCreature, until all my\r\nharmones work properly.\r\nI hate people who act\r\negoistic..\r\nI dont underestimate\r\nanyone.\r\nMisunderstanding has\r\nplayed appreciably great\r\nstrocks in my life and I\r\nam crazier than that,\r\nbecause I enjoy it.\r\nAnd I can forgive the\r\nperson who kills me, but\r\nnot the one who misused\r\nme.Now I know, you are\r\nthinking, what the hell\r\nthis person might be of\r\nuse??\r\nThe answer is, I also dont\r\nknow.But still I hate\r\npeople who misuse\r\nme..now leave it.\r\nI love to live with my\r\nfriends and for friendship\r\nI dont consider their any\r\nprevious achievements. I\r\nlove all those who feel\r\ncomfortable with me and\r\nwho make me feel\r\ncomfortable with them\r\nAnd I never ever go\r\nbehind any person\r\n(irrespective of their SEX)\r\nwho dont like my attitude\r\nand dont want to be my\r\nfriend..\r\nI believe in GOD..I am\r\noptimistic.I am Moody.\r\nI always think positive>\r\nWhich have never helped\r\nme to achieve anything,\r\nbut still it has become a\r\nhabit.\r\nI forgive people soon, as I\r\nfeel that if we love\r\nourselves after doing\r\nthousands of\r\nmistakes ,then how can\r\nwe hate others for der 1\r\nmistake...sounds\r\nphilosophical..bt its what i\r\nfeel..\r\nI love to be Honest nd\r\ngreatly appriciate\r\nHonesty...\r\nAnd one thing I have\r\nobserved about myself is,I\r\ndont go behind famous\r\npeople(bussy people), as it\r\nwould be an extra burden\r\nto them. **I dont like to\r\ndisturb anybody**\r\nI enjoy the company of\r\npeople who are FREE.I too\r\nlove to live freely..\r\nI believe that people wont\r\nunderstand the\r\nimportance of the other\r\nperson until that person\r\nis found dead.\r\nAnd I am not an\r\nimportant person,\r\ncan you guess Y ?\r\nstupid.\r\nbecauseI am still\r\nalive.\r\nFor those who doesnt like\r\nme, I dont have any\r\ncomments, because its\r\ntheir life and I am no one\r\nto poke my nose..\r\nAnd for those who hate\r\nme.hope I am not soooo\r\nbad(Anyway, its left to\r\nyou).\r\nI never think bad for\r\nanyone.etc!\r\nI guess, you are my\r\nfriend..because you read\r\nuntil here, soooo long.Do\r\nyou know.Friendship\r\nisnt aboutwhom you\r\nhave known the\r\nLongest.who came 1st or\r\nwho Cares the BestIts all\r\nabout Who came and\r\nNever Left.\r\nAnd I have crises of such\r\nfriends.but still as I said\r\nearlier, I am very much\r\noptimistic, and I am still\r\nin a hope that I will also\r\nget friends who will stay\r\ntill the end, even when\r\nthere is no use from me.\r\nSome times I feel that I\r\nhave the ability to change\r\nevery thing in this world,\r\nbut luckily soon I realize\r\nthat I wasnt able to\r\nchange myself since past\r\n6 years!\r\nI love animals a lot..in\r\nzoo.But some of my\r\nfriends prefer to live in\r\nHome.hahah..Oops,Sorry.I\r\nknow, its a bad joke!\r\n...\r\nyap..\r\nthats it..........','mys_cool@yahoo.com','5f4dcc3b5aa765d61d8327deb882cf99',99,1475,0,0,100000485178660,'2013-03-26 17:34:55','2013-03-26 17:37:00');
